@njit(parallel=True)
def TreeDeBruijn(step):
  N = 7
  new_cluster = np.zeros(shape=((2 ** step) - 1, (2 ** step) - 1), dtype=np.int64)
  for i in range(0, 2 ** (step - 1) - 1):
    new_cluster[i, i * 2 + 1] = 1
    new_cluster[i, i * 2 + 2] = 1
    new_cluster[i * 2 + 1, i] = 1
    new_cluster[i * 2 + 2, i] = 1
  for i in range(0, step):
    j = 2 ** i - 1
    for k in range(j, 2 ** i):
      shl = simple_shl(k - j, i)
      for s in shl:
        new_cluster[k, s + j] = 1
        new_cluster[s + j, k] = 1
  for i in range(0, len(new_cluster)):
    new_cluster[i, i] = 0
  return new_cluster

