@njit(parallel=True)
def ProductTreeDeBruijn(step):
  tree_cluster = np.zeros(shape=((2 ** step) - 1, (2 ** step) - 1), dtype=np.int64)
  debrujin_cluster = np.zeros(shape=((2**step), (2**step)), dtype=np.int64)
