  for i in range(0, 2 ** step - 1):
    tree_cluster[i, i * 2 + 1] = 1
    tree_cluster[i, i * 2 + 2] = 1
    tree_cluster[i * 2 + 1, i] = 1
    tree_cluster[i * 2 + 2, i] = 1
  for i in range(0, 2 ** step):
    shl = simple_shl(i, step)
    for s in shl:
      debrujin_cluster[i, s] = 1
      debrujin_cluster[s, i] = 1
  N = len(tree_cluster)
  for i in range(0, 2 ** step):
    for j in range(0, N):
      for k in range(0, N):
        new_cluster[N * i + j, N * i + k] = tree_cluster[j, k]
  for i in range(0, len(debrujin_cluster)):
    for j in range(0, len(debrujin_cluster)):
      if debrujin_cluster[i, j] == 1:
        for k in range(0, N):
          new_cluster[i * N + k, j * N + k] = 1
  return new_cluster

